import React from "react";
import "./App.css";
import NavBar from "./components/common/NavBar";
import Home from "./pages/Home";
import Recipies from "./pages/Recipies";
import { BrowserRouter as Router } from "react-router-dom";
function App() {
  return (
    <Router>
      <NavBar />
      <Home />
      <Recipies />
    </Router>
  );
}

export default App;
